import React from 'react';
//import './App.css';
import Page1 from './screens/Page1';
import NavBar from './screens/NavBar/NavBar';
import MainScreen from './screens/MainScreen/MainScreen';
import Footer from './screens/Footer/Footer';


function App() {
  return (
    <div>
      <NavBar/>
      <MainScreen/>
      <Page1 />
      <Footer/>
    </div>
  );
}

export default App;
